Worked hard and knew where the net was, that’s all we ask 
Sorry you missed the trophies either side, but you were always a hope when things started going a different way. Ta la 🟣🔵

🎯 You’re not elected to achieve, run a company, please a shareholder or balance a spreadsheet. 

